\documentclass{article}

% Importing TikZ package
\usepackage{tikz}

% Defining the dimensions of the cell phone
\def\phoneWidth{4}
\def\phoneHeight{8}
\def\phoneDepth{0.5}

% Defining the dimensions of the screen
\def\screenWidth{3.5}
\def\screenHeight{7.5}

% Defining the dimensions of the home button
\def\homeButtonWidth{0.5}
\def\homeButtonHeight{0.5}

% Defining the dimensions of the camera
\def\cameraWidth{0.5}
\def\cameraHeight{0.5}

% Defining the dimensions of the speaker
\def\speakerWidth{1}
\def\speakerHeight{0.25}

% Defining the dimensions of the volume buttons
\def\volumeButtonWidth{0.25}
\def\volumeButtonHeight{0.5}

% Defining the dimensions of the power button
\def\powerButtonWidth{0.5}
\def\powerButtonHeight{0.25}

% Defining the dimensions of the charging port
\def\chargingPortWidth{0.5}
\def\chargingPortHeight{0.25}

% Defining the dimensions of the headphone jack
\def\headphoneJackWidth{0.25}
\def\headphoneJackHeight{0.25}

% Defining the dimensions of the SIM card slot
\def\simCardSlotWidth{0.5}
\def\simCardSlotHeight{0.25}

% Defining the dimensions of the antenna lines
\def\antennaLineWidth{0.1}

\begin{document}

% Creating the cell phone
\begin{tikzpicture}

% Drawing the back of the cell phone
\fill[black] (0,0) rectangle (\phoneWidth,\phoneHeight);

% Drawing the camera
\fill[gray] (\phoneWidth-\cameraWidth-0.1,\phoneHeight-\cameraHeight-0.1) rectangle (\phoneWidth-0.1,\phoneHeight-0.1);

% Drawing the speaker
\fill[gray] (\phoneWidth/2-\speakerWidth/2,\phoneHeight-\cameraHeight-\speakerHeight-0.1) rectangle (\phoneWidth/2+\speakerWidth/2,\phoneHeight-\cameraHeight-0.1);

% Drawing the antenna lines
\draw[line width=\antennaLineWidth] (0.2,\phoneHeight-0.2) -- (0.2,\phoneHeight-0.5) -- (0.8,\phoneHeight-0.5) -- (0.8,\phoneHeight-0.2);
\draw[line width=\antennaLineWidth] (\phoneWidth-0.2,\phoneHeight-0.2) -- (\phoneWidth-0.2,\phoneHeight-0.5) -- (\phoneWidth-0.8,\phoneHeight-0.5) -- (\phoneWidth-0.8,\phoneHeight-0.2);

% Drawing the front of the cell phone
\fill[white] (0+\phoneDepth,0+\phoneDepth) rectangle (\phoneWidth-\phoneDepth,\phoneHeight-\phoneDepth);

% Drawing the screen
\fill[black] (\phoneWidth/2-\screenWidth/2+\phoneDepth/2,\phoneHeight/2-\screenHeight/2+\phoneDepth/2) rectangle (\phoneWidth/2+\screenWidth/2-\phoneDepth/2,\phoneHeight/2+\screenHeight/2-\phoneDepth/2);

% Drawing the home button
\fill[gray] (\phoneWidth/2-\homeButtonWidth/2,\phoneDepth) rectangle (\phoneWidth/2+\homeButtonWidth/2,\homeButtonHeight+\phoneDepth);

% Drawing the volume buttons
\fill[gray] (\phoneWidth-\volumeButtonWidth-\phoneDepth,\phoneHeight/2-\volumeButtonHeight/2) rectangle (\phoneWidth-\phoneDepth,\phoneHeight/2+\volumeButtonHeight/2);
\fill[gray] (\phoneDepth,\phoneHeight/2-\volumeButtonHeight/2) rectangle (\volumeButtonWidth+\phoneDepth,\phoneHeight/2+\volumeButtonHeight/2);

% Drawing the power button
\fill[gray] (\phoneWidth-\powerButtonWidth-\phoneDepth,\phoneDepth) rectangle (\phoneWidth-\phoneDepth,\powerButtonHeight+\phoneDepth);

% Drawing the charging port
\fill[gray] (\phoneWidth-\chargingPortWidth-\phoneDepth,\phoneDepth+\powerButtonHeight+\phoneDepth) rectangle (\phoneWidth-\phoneDepth,\phoneDepth+\powerButtonHeight+\phoneDepth+\chargingPortHeight);

% Drawing the headphone jack
\fill[gray] (\phoneDepth,\phoneDepth+\powerButtonHeight+\phoneDepth) rectangle (\headphoneJackWidth+\phoneDepth,\phoneDepth+\powerButtonHeight+\phoneDepth+\headphoneJackHeight);

% Drawing the SIM card slot
\fill[gray] (\phoneWidth-\simCardSlotWidth-\phoneDepth,\phoneHeight-\simCardSlotHeight-\phoneDepth) rectangle (\phoneWidth-\phoneDepth,\phoneHeight-\phoneDepth);

\end{tikzpicture}

\end{document}

