\def\turntableWidth{2.5}
\def\turntableHeight{2.5}

% Defining the position of the microwave
\def\microwaveX{0}
\def\microwaveY{0}

% Defining the position of the door
\def\doorX{\microwaveX + \microwaveWidth/2 - \doorWidth/2}
\def\doorY{\microwaveY + \microwaveHeight/2 - \doorHeight/2}

% Defining the position of the buttons
\def\buttonX{\microwaveX + \microwaveWidth/2 - \buttonWidth/2}
\def\buttonY{\microwaveY + \microwaveHeight - \buttonHeight - 0.2}

