\def\displayX{\microwaveX + \microwaveWidth/2 - \displayWidth/2}
\def\displayY{\microwaveY + \microwaveHeight - \displayHeight - 0.7}

% Defining the position of the turntable
\def\turntableX{\microwaveX + \microwaveWidth/2 - \turntableWidth/2}
\def\turntableY{\microwaveY + \microwaveHeight/2 - \turntableHeight/2}

