\documentclass{article}

% Importing TikZ package
\usepackage{tikz}

% Setting up the page dimensions
\usepackage[margin=0.5in]{geometry}

% Defining the colors to be used
\definecolor{keycolor}{RGB}{255,255,255}
\definecolor{framecolor}{RGB}{0,0,0}

% Defining the size of the keys
\newcommand{\keysize}{1.2cm}

% Defining the distance between the keys
\newcommand{\keydist}{0.2cm}

% Defining the thickness of the frame
\newcommand{\framethickness}{0.1cm}

% Defining the radius of the corners
\newcommand{\cornerradius}{0.2cm}

% Defining the main function to draw the keys
\newcommand{\drawkey}[2]{
    \filldraw[fill=keycolor, draw=framecolor, line width=\framethickness, rounded corners=\cornerradius] (#1,#2) rectangle (#1+\keysize,#2-\keysize);
}

% Defining the main function to draw the keyboard
\newcommand{\drawkeyboard}{
    % Drawing the first row of keys
    \foreach \i in {0,...,12} {
        \drawkey{\i*\keysize+\i*\keydist}{0};
    }

    % Drawing the second row of keys
    \foreach \i in {0,...,11} {
        \drawkey{\i*\keysize+\i*\keydist+\keysize/2+\keydist/2}{-\keysize-\keydist};
    }

    % Drawing the third row of keys
    \foreach \i in {0,...,9} {
        \drawkey{\i*\keysize+\i*\keydist+\keysize+\keydist}{-2*\keysize-2*\keydist};
    }

    % Drawing the space bar
    \filldraw[fill=keycolor, draw=framecolor, line width=\framethickness, rounded corners=\cornerradius] (5*\keysize+5*\keydist,-3*\keysize-3*\keydist) rectangle (9*\keysize+9*\keydist,-4*\keysize-3*\keydist);
}

\begin{document}

% Creating the TikZ picture
\begin{tikzpicture}
    \drawkeyboard;
\end{tikzpicture}

\end{document}

