\usepackage{tikz}

% Defining the dimensions of the air conditioner
\def\acwidth{4}
\def\acheight{3}
\def\acdepth{2}

% Defining the coordinates of the air conditioner
\def\acx{0}
\def\acy{0}
\def\acz{0}

% Defining the color of the air conditioner
\definecolor{accolor}{RGB}{255, 255, 255}

% Defining the thickness of the air conditioner
\def\acthickness{0.1}

% Defining the coordinates of the air conditioner's vents
\def\ventx{\acx + \acwidth/2}
\def\venty{\acy + \acheight/2}
\def\ventz{\acz + \acdepth/2}

% Defining the dimensions of the air conditioner's vents
\def\ventwidth{0.5}
\def\ventheight{0.5}

% Defining the color of the air conditioner's vents
\definecolor{ventcolor}{RGB}{0, 0, 0}

% Defining the thickness of the air conditioner's vents
\def\ventthickness{0.05}

\begin{document}

% Creating the air conditioner
\begin{tikzpicture}[x=1cm, y=1cm, z=-1cm]
    % Drawing the front face of the air conditioner
    \draw[fill=accolor, thick=\acthickness] (\acx, \acy, \acz) -- (\acx+\acwidth, \acy, \acz) -- (\acx+\acwidth, \acy+\acheight, \acz) -- (\acx, \acy+\acheight, \acz) -- cycle;
    % Drawing the top face of the air conditioner
    \draw[fill=accolor, thick=\acthickness] (\acx, \acy+\acheight, \acz) -- (\acx+\acwidth, \acy+\acheight, \acz) -- (\acx+\acwidth, \acy+\acheight, \acz+\acdepth) -- (\acx, \acy+\acheight, \acz+\acdepth) -- cycle;
    % Drawing the left face of the air conditioner
    \draw[fill=accolor, thick=\acthickness] (\acx, \acy, \acz) -- (\acx, \acy, \acz+\acdepth) -- (\acx, \acy+\acheight, \acz+\acdepth) -- (\acx, \acy+\acheight, \acz) -- cycle;
    % Drawing the right face of the air conditioner
    \draw[fill=accolor, thick=\acthickness] (\acx+\acwidth, \acy, \acz) -- (\acx+\acwidth, \acy, \acz+\acdepth) -- (\acx+\acwidth, \acy+\acheight, \acz+\acdepth) -- (\acx+\acwidth, \acy+\acheight, \acz) -- cycle;
    % Drawing the back face of the air conditioner
    \draw[fill=accolor, thick=\acthickness] (\acx, \acy, \acz+\acdepth) -- (\acx+\acwidth, \acy, \acz+\acdepth) -- (\acx+\acwidth, \acy+\acheight, \acz+\acdepth) -- (\acx, \acy+\acheight, \acz+\acdepth) -- cycle;

    % Drawing the vents of the air conditioner
    \draw[fill=ventcolor, thick=\ventthickness] (\ventx-\ventwidth/2, \venty-\ventheight/2, \ventz) -- (\ventx+\ventwidth/2, \venty-\ventheight/2, \ventz) -- (\ventx+\ventwidth/2, \venty+\ventheight/2, \ventz) -- (\ventx-\ventwidth/2, \venty+\ventheight/2, \ventz) -- cycle;
    \draw[fill=ventcolor, thick=\ventthickness] (\ventx-\ventwidth/2, \venty, \ventz-\ventheight/2) -- (\ventx+\ventwidth/2, \venty, \ventz-\ventheight/2) -- (\ventx+\ventwidth/2, \venty, \ventz+\ventheight/2) -- (\ventx-\ventwidth/2, \venty, \ventz+\ventheight/2) -- cycle;
    \draw[fill=ventcolor, thick=\ventthickness] (\ventx, \venty-\ventheight/2, \ventz-\ventwidth/2) -- (\ventx, \venty-\ventheight/2, \ventz+\ventwidth/2) -- (\ventx, \venty+\ventheight/2, \ventz+\ventwidth/2) -- (\ventx, \venty+\ventheight/2, \ventz-\ventwidth/2) -- cycle;
\end{tikzpicture}

\end{document}

