\usepackage{tikz}

% Defining the clock face
\def\clockface{
    % Drawing the outer circle
    \draw[fill=white] (0,0) circle (2cm);
    % Drawing the inner circle
    \draw[fill=black] (0,0) circle (1.8cm);
    % Drawing the hour markers
    \foreach \angle in {0,30,...,330}
        \draw[line width=1.5pt] (\angle:1.6cm) -- (\angle:1.8cm);
    % Drawing the minute markers
    \foreach \angle in {0,6,...,354}
        \draw (\angle:1.6cm) -- (\angle:1.7cm);
    % Drawing the hour hand
    \draw[line width=2pt] (0,0) -- (60:0.8cm);
    % Drawing the minute hand
    \draw[line width=1.5pt] (0,0) -- (180:1.2cm);
    % Drawing the second hand
    \draw[red, line width=0.5pt] (0,0) -- (270:1.6cm);
    % Drawing the center dot
    \fill[black] (0,0) circle (0.1cm);
}

% Defining the alarm clock
\def\alarmclock{
    % Drawing the clock face
    \clockface
    % Drawing the alarm bell
    \draw[line width=1.5pt] (-0.5cm,1.8cm) -- (-0.5cm,2.2cm) -- (0.5cm,2.2cm) -- (0.5cm,1.8cm) -- cycle;
    \draw[line width=1.5pt] (-0.7cm,1.8cm) -- (-0.7cm,2.5cm) -- (0.7cm,2.5cm) -- (0.7cm,1.8cm) -- cycle;
    % Drawing the alarm hand
    \draw[line width=1.5pt] (0,0) -- (120:0.8cm);
}

