\def\circlex{\figurex+\circleradius}
\def\circley{\figurey+\circleradius}

% Define the coordinates of the legs
\def\legx{\circlex}
\def\legy{\circley-\circleradius}

% Define the length of the legs
\def\leglength{1.5cm}

