\def\headx{\circlex}
\def\heady{\circley+2*\circleradius}

% Define the radius of the head
\def\headradius{0.5cm}

% Define the coordinates of the eyes
\def\eyex{\headx-0.2cm}
\def\eyey{\heady+0.1cm}

% Define the radius of the eyes
\def\eyeradius{0.1cm}

% Define the coordinates of the mouth
