\newcommand{\heartsize}{2}

% Defining the coordinates of the heart
\newcommand{\heartcoordinates}{
    (0,0) .. controls +(2*\heartsize,0) and +(0,2*\heartsize) .. 
    (\heartsize,4*\heartsize) .. controls +(0,-2*\heartsize) and +(-2*\heartsize,0) .. 
    (0,2*\heartsize) .. controls +(2*\heartsize,0) and +(0,-2*\heartsize) .. 
    (-\heartsize,4*\heartsize) .. controls +(0,2*\heartsize) and +(-2*\heartsize,0) .. 
    (0,0)
}

% Defining the beating heart animation
\newcommand{\beatingheart}{
    \foreach \x in {0,0.1,...,0.9,1,0.9,...,0}{
        \draw[red,thick,fill=red!50!white] 
        (\x*\heartsize,0) .. controls +(2*\heartsize,0) and +(0,2*\heartsize) .. 
        (\heartsize+\x*\heartsize,4*\heartsize) .. controls +(0,-2*\heartsize) and +(-2*\heartsize,0) .. 
        (\x*\heartsize,2*\heartsize) .. controls +(2*\heartsize,0) and +(0,-2*\heartsize) .. 
        (-\heartsize+\x*\heartsize,4*\heartsize) .. controls +(0,2*\heartsize) and +(-2*\heartsize,0) .. 
        (\x*\heartsize,0);
    }
}

