\usepackage{tikz}

% Setting up the page dimensions
\usepackage[paperwidth=10cm, paperheight=5cm, margin=0cm]{geometry}

% Defining the length of the tape measure
\def\tapeLength{8cm}

% Defining the width of the tape measure
\def\tapeWidth{1cm}

% Defining the height of the tape measure
\def\tapeHeight{0.2cm}

% Defining the length of the tape measure's hook
\def\hookLength{0.5cm}

% Defining the width of the tape measure's hook
\def\hookWidth{0.2cm}

% Defining the height of the tape measure's hook
\def\hookHeight{0.2cm}

% Defining the length of the tape measure's markings
\def\markingLength{0.2cm}

% Defining the width of the tape measure's markings
\def\markingWidth{0.05cm}

% Defining the height of the tape measure's markings
\def\markingHeight{0.1cm}

% Defining the distance between the tape measure's markings
\def\markingDistance{0.5cm}

% Defining the color of the tape measure
\definecolor{tapeColor}{RGB}{255, 102, 0}

% Defining the color of the tape measure's markings
\definecolor{markingColor}{RGB}{255, 255, 255}

% Defining the color of the tape measure's hook
\definecolor{hookColor}{RGB}{0, 0, 0}

% Defining the color of the tape measure's background
\definecolor{backgroundColor}{RGB}{255, 255, 255}

% Setting up the TikZ environment
\begin{document}

\begin{tikzpicture}

% Drawing the tape measure's background
\fill[backgroundColor] (0,0) rectangle (\tapeLength,\tapeHeight);

% Drawing the tape measure's markings
\foreach \i in {0,...,15}
    \fill[markingColor] (\i*\markingDistance,0) rectangle ++(\markingWidth,\markingHeight);

% Drawing the tape measure's hook
\fill[hookColor] (\tapeLength-\hookLength,\tapeHeight) rectangle ++(\hookWidth,-\hookHeight);

% Drawing the tape measure
\fill[tapeColor] (0,0) rectangle ++(\tapeWidth,\tapeHeight);

% Drawing the tape measure's outline
\draw[line width=0.1cm] (0,0) rectangle (\tapeLength,\tapeHeight);

\end{tikzpicture}

\end{document}

