  % Drawing the hour hand
  \draw[thick,rotate=\hourAngle] (\width/2,0) -- (0,\hourHandLength);
  % Drawing the minute hand
  \draw[thick,rotate=\minuteAngle] (\width/2,0) -- (0,\minuteHandLength);
  % Drawing the second hand
