\usepackage{tikz}

% Define book dimensions
\def\bookwidth{4}
\def\bookheight{6}
\def\bookdepth{0.5}

% Define cover color
\definecolor{covercolor}{RGB}{255, 204, 153}

% Define spine color
\definecolor{spinecolor}{RGB}{255, 153, 51}

% Define page color
\definecolor{pagecolor}{RGB}{255, 255, 204}

% Define page margin
\def\pagemargin{0.2}

% Define page width and height
\def\pagewidth{\bookwidth - 2*\pagemargin}
\def\pageheight{\bookheight - 2*\pagemargin}

% Define page x and y positions
\def\pagex{\pagemargin}
\def\pagey{\pagemargin}

% Define spine width
\def\spinewidth{0.5}

% Define spine x position
\def\spinex{\bookwidth/2}

% Define cover x position
\def\coverx{\bookwidth/2}

% Define cover y position
\def\covery{\bookheight/2}

% Define cover width
\def\coverwidth{\bookwidth}

% Define cover height
\def\coverheight{\bookheight}

% Define cover depth
\def\coverdepth{\bookdepth}

% Define spine height
\def\spineheight{\bookheight}

% Define page depth
\def\pagedepth{\bookdepth}

% Define page border
\def\pageborder{0.1}

% Define page x and y positions with border
\def\pageborderx{\pagex + \pageborder}
\def\pagebordery{\pagey + \pageborder}

% Define page width and height with border
\def\pageborderwidth{\pagewidth - 2*\pageborder}
\def\pageborderheight{\pageheight - 2*\pageborder}

% Define page x and y positions with border and margin
\def\pagemarginx{\pageborderx + \pagemargin}
\def\pagemarginy{\pagebordery + \pagemargin}

% Define page width and height with border and margin
\def\pagemarginwidth{\pageborderwidth - 2*\pagemargin}
\def\pagemarginheight{\pageborderheight - 2*\pagemargin}

% Define cover
\def\cover{
  % Draw cover rectangle
  \fill[covercolor] (\coverx-\coverwidth/2, \covery-\coverheight/2, -\coverdepth/2) rectangle (\coverx+\coverwidth/2, \covery+\coverheight/2, \coverdepth/2);
}

% Define spine
\def\spine{
  % Draw spine rectangle
  \fill[spinecolor] (\spinex-\spinewidth/2, \covery-\spineheight/2, -\coverdepth/2) rectangle (\spinex+\spinewidth/2, \covery+\spineheight/2, \coverdepth/2);
}

% Define page
\def\page{
  % Draw page rectangle
  \fill[pagecolor] (\pagemarginx, \pagemarginy, -\pagedepth/2) rectangle (\pagemarginx+\pagemarginwidth, \pagemarginy+\pagemarginheight, \pagedepth/2);
}

% Define book
\def\book{
  % Draw cover
  \cover
  % Draw spine
  \spine
  % Draw front page
  \begin{scope}[shift={(\coverx-\coverwidth/2+\pagemargin, \covery-\coverheight/2+\pagemargin, 0)}]
    \page
  \end{scope}
  % Draw back page
  \begin{scope}[shift={(\coverx+\coverwidth/2-\pagemargin, \covery-\coverheight/2+\pagemargin, 0)}, rotate around y=180]
    \page
  \end{scope}
}

% Begin TikZ picture
\begin{document}

\begin{tikzpicture}

% Draw book
\book

\end{tikzpicture}

\end{document}

