\documentclass{article}

% Importing the TikZ package
\usepackage{tikz}

% Setting the page size and margins
\usepackage[margin=0.5in, paperwidth=8.5in, paperheight=11in]{geometry}

% Defining the colors to be used
\definecolor{shellcolor}{RGB}{255, 204, 102}
\definecolor{linecolor}{RGB}{0, 0, 0}

% Starting the TikZ picture environment
\begin{document}

\begin{tikzpicture}

% Setting the initial angle and radius
\def\angle{0}
\def\radius{0.1}

% Setting the number of loops and the increment value
\def\loops{100}
\def\increment{0.1}

% Looping through the spiral shell
\foreach \i in {1,...,\loops} {

  % Calculating the new angle and radius
  \pgfmathsetmacro{\newangle}{\angle + \increment}
  \pgfmathsetmacro{\newradius}{\radius + \increment}

  % Drawing the spiral shell
  \draw[line width=0.5pt, color=linecolor] (\angle:\radius) -- (\newangle:\newradius);

  % Filling the spiral shell
  \filldraw[fill=shellcolor, draw=linecolor] (\newangle:\newradius) arc (\newangle:\angle:\newradius) -- cycle;

  % Updating the angle and radius
  \global\let\angle=\newangle
  \global\let\radius=\newradius
}

% Ending the TikZ picture environment
\end{tikzpicture}

\end{document}

