    % Draw the inner half-tooth slope
    \draw[thick] ({(\i-1)*\toothangle+\halftoothangle+\halftoothslopeangle}:\gearradius/2) -- ({(\i-1)*\toothangle+\halftoothslopehorizontalangleinner}:{\gearradius/2+\halftoothslopeverticalangleinner}) -- ({\i*\toothangle-\halftoothangle-\halftoothslopeangle}:\gearradius/2) -- ({\i*\toothangle-\halftoothslopehorizontalangleinner}:{\gearradius/2+\halftoothslopeverticalangleinner}) -- cycle;

