    \draw[thick] ({\i*\toothangle-\halftoothangle-\halftoothvalleyangle}:\gearradius/2) -- ({\i*\toothangle-\halftoothvalleyhorizontalangleinner}:{\gearradius/2-\halftoothvalleyverticalangleinner}) -- ({\i*\toothangle-\halftoothangle}:\gearradius/2) -- ({\i*\toothangle-\halftoothangle+\halftoothvalleyhorizontalangleinner}:{\gearradius/2-\halftoothvalleyverticalangleinner}) -- cycle;

