  % Draw the light gray squares
  \foreach \x in {0,1,2,3,4,5,6,7}{
    \foreach \y in {0,1,2,3,4,5,6,7}{
      \fill[lightgray] (\x*\sqsize,\y*\sqsize) rectangle ++(\sqsize,\sqsize);
    }
  }

  % Draw the dark gray squares
  \foreach \x in {0,2,4,6}{
    \foreach \y in {1,3,5,7}{
      \fill[darkgray] (\x*\sqsize,\y*\sqsize) rectangle ++(\sqsize,\sqsize);
    }
  }

  % Draw the light blue squares
  \foreach \x in {1,3,5,7}{
    \foreach \y in {0,2,4,6}{
      \fill[lightblue] (\x*\sqsize,\y*\sqsize) rectangle ++(\sqsize,\sqsize);
    }
  }

  % Draw the dark blue squares
  \foreach \x in {0,2,4,6}{
    \foreach \y in {0,2,4,6}{
      \fill[darkblue] (\x*\sqsize,\y*\sqsize) rectangle ++(\sqsize,\sqsize);
    }
  }
}

