  \inheritanchorborder[from=rectangle]
  \inheritanchor[from=rectangle]{center}
  \inheritanchor[from=rectangle]{north}
  \inheritanchor[from=rectangle]{south}
  \inheritanchor[from=rectangle]{west}
  \inheritanchor[from=rectangle]{east}
  % Define the shape's background path
  \backgroundpath{
    % Draw the hammer head
    \pgfpathrectanglecorners{\pgfpoint{-0.5cm}{0.5cm}}{\pgfpoint{0.5cm}{-0.5cm}}
    % Draw the hammer handle
    \pgfpathmoveto{\pgfpoint{-0.5cm}{0.5cm}}
    \pgfpathlineto{\pgfpoint{-0.5cm}{1.5cm}}
    \pgfpathlineto{\pgfpoint{0.5cm}{1.5cm}}
    \pgfpathlineto{\pgfpoint{0.5cm}{0.5cm}}
    % Draw the hammer claw
    \pgfpathmoveto{\pgfpoint{0.5cm}{0.5cm}}
    \pgfpathlineto{\pgfpoint{1cm}{0.5cm}}
    \pgfpathlineto{\pgfpoint{1cm}{-0.5cm}}
    \pgfpathlineto{\pgfpoint{0.5cm}{-0.5cm}}
    \pgfpathclose
  }
}

\pgfdeclareshape{pick}{
  \inheritsavedanchors[from=rectangle]
  \inheritanchorborder[from=rectangle]
  \inheritanchor[from=rectangle]{center}
  \inheritanchor[from=rectangle]{north}
  \inheritanchor[from=rectangle]{south}
  \inheritanchor[from=rectangle]{west}
  \inheritanchor[from=rectangle]{east}
  % Define the shape's background path
  \backgroundpath{
    % Draw the pick head
    \pgfpathmoveto{\pgfpoint{-0.5cm}{0.5cm}}
    \pgfpathlineto{\pgfpoint{0.5cm}{0.5cm}}
    \pgfpathlineto{\pgfpoint{0.5cm}{-0.5cm}}
    \pgfpathlineto{\pgfpoint{-0.5cm}{-0.5cm}}
    \pgfpathclose
    % Draw the pick handle
    \pgfpathmoveto{\pgfpoint{0cm}{0.5cm}}
    \pgfpathlineto{\pgfpoint{0cm}{1.5cm}}
  }
}

