% Define the thickness of the onion layers
\def\layerThickness{0.2cm}

% Define the distance between the layers
\def\layerDistance{0.1cm}

% Define the shape of the onion layers
\def\layerShape{circle}

% Define the starting angle for the onion layers
\def\startAngle{0}

