% Define the dimensions of the pill
\def\pillwidth{2cm}
\def\pillheight{1cm}

% Define the thickness of the border
\def\borderthickness{0.1cm}

% Define the coordinates of the pill's corners
\def\pilltopleft{(0,0)}
\def\pillbottomleft{(0,-\pillheight)}
\def\pilltopright{(\pillwidth,0)}
\def\pillbottomright{(\pillwidth,-\pillheight)}

% Define the coordinates of the pill's border
\def\borderleft{(\borderthickness/2,-\borderthickness/2)}
\def\bordertop{(-\borderthickness/2,\borderthickness/2)}
\def\borderright{(\pillwidth+\borderthickness/2,-\borderthickness/2)}
\def\borderbottom{(-\borderthickness/2,-\pillheight-\borderthickness/2)}

% Define the coordinates of the pill's fill
\def\filltopleft{(\borderthickness/2,-\borderthickness/2)}
\def\fillbottomleft{(\borderthickness/2,-\pillheight+\borderthickness/2)}
\def\filltopright{(\pillwidth-\borderthickness/2,-\borderthickness/2)}
\def\fillbottomright{(\pillwidth-\borderthickness/2,-\pillheight+\borderthickness/2)}

