% Define spine color
\definecolor{spinecolor}{RGB}{255, 153, 51}

% Define page color
\definecolor{pagecolor}{RGB}{255, 255, 204}

% Define book cover
\newcommand{\bookcover}{
  % Draw cover
  \fill[covercolor] (0,0) rectangle (\bookwidth,\bookheight);
  % Draw spine
  \fill[spinecolor] (\bookwidth,0) -- (\bookwidth+\bookdepth,0) -- (\bookwidth+\bookdepth,\bookheight) -- (\bookwidth,\bookheight) -- cycle;
}

% Define book pages
\newcommand{\bookpages}{
  % Draw pages
  \fill[pagecolor] (0,0) rectangle (\bookwidth,\bookheight);
  % Draw page edges
  \draw[line width=0.1pt] (0,0) -- (\bookwidth,0);
  \draw[line width=0.1pt] (0,\bookheight) -- (\bookwidth,\bookheight);
  \draw[line width=0.1pt] (0,0) -- (0,\bookheight);
  \draw[line width=0.1pt] (\bookwidth,0) -- (\bookwidth,\bookheight);
}

% Define closed book
\newcommand{\closedbook}{
  % Draw book cover
  \bookcover
  % Draw book pages
  \begin{scope}[shift={(0.2,0.2)}]
    \bookpages
  \end{scope}
}

