% Define the size of the fist
\def\fistsize{1cm}

% Define the color of the fist
\definecolor{fistcolor}{RGB}{255, 204, 0}

% Define the thickness of the fist's outline
\def\fistlinewidth{0.1cm}

% Define the angle of the fist's thumb
\def\thumbangle{135}

% Define the angle of the fist's fingers
\def\fingerangle{45}

% Define the distance between the fingers
\def\fingersep{0.2cm}

% Define the distance between the thumb and the fingers
\def\thumbsep{0.3cm}

% Define the fist's outline
\def\fistoutline{
    (0,0) circle (\fistsize)
}

% Define the thumb
\def\thumb{
    (\thumbangle:\fistsize+\thumbsep) -- (\thumbangle:\fistsize-\thumbsep) -- (\thumbangle-90:\fistsize-\thumbsep) -- (\thumbangle-90:\fistsize+\thumbsep) -- cycle
}

% Define the fingers
\def\fingers{
    \foreach \angle in {\fingerangle,\fingerangle+60,\fingerangle+120}{
        (\angle:\fistsize+\fingersep) -- (\angle:\fistsize-\fingersep)
    }
}

% Define the complete fist
\def\fist{
    \fill[fistcolor] \fistoutline;
    \draw[line width=\fistlinewidth] \fistoutline;
    \fill[fistcolor] \thumb;
    \draw[line width=\fistlinewidth] \thumb;
    \draw[line width=\fistlinewidth] \fingers;
}

