\documentclass{article}

% Load TikZ package
\usepackage{tikz}

% Define the size of the diagram
\def\width{4cm}
\def\height{6cm}

% Define the coordinates of the exit
\def\exitx{2cm}
\def\exity{5cm}

% Define the coordinates of the door
\def\doorx{2cm}
\def\doory{0cm}

% Define the thickness of the door
\def\doorthick{0.2cm}

% Define the color of the door
\definecolor{doorcolor}{RGB}{255, 255, 255}

% Define the color of the exit sign
\definecolor{exitsigncolor}{RGB}{255, 0, 0}

% Define the thickness of the exit sign
\def\exitsignthick{0.1cm}

% Define the size of the exit sign
\def\exitsignsize{0.8cm}

% Define the coordinates of the exit sign
\def\exitsignx{\exitx}
\def\exitsigny{\exity - \exitsignsize}

% Define the coordinates of the exit sign border
\def\exitsignborderx{\exitsignx}
\def\exitsignbordery{\exity - \exitsignsize}

% Define the radius of the exit sign border
\def\exitsignborderradius{\exitsignsize / 2}

% Define the thickness of the exit sign border
\def\exitsignborderthick{0.05cm}

% Define the coordinates of the exit sign arrow
\def\exitsignarrowx{\exitsignx}
\def\exitsignarrowy{\exity - \exitsignsize / 2}

% Define the length of the exit sign arrow
\def\exitsignarrowlength{0.5cm}

% Define the thickness of the exit sign arrow
\def\exitsignarrowthick{0.1cm}

% Define the coordinates of the exit sign text
\def\exitsigntextx{\exitsignx}
\def\exitsigntexty{\exity - \exitsignsize / 2}

% Define the font size of the exit sign text
\def\exitsigntextsize{\tiny}

\begin{document}

% Create the TikZ picture environment
\begin{tikzpicture}[x=\width, y=\height]

% Draw the exit sign border
\draw[color=exitsigncolor, fill=exitsigncolor, thick=\exitsignborderthick, rounded corners=\exitsignborderradius] (\exitsignborderx, \exitsignbordery) rectangle ++(\exitsignsize, \exitsignsize);

% Draw the exit sign arrow
\draw[color=exitsigncolor, thick=\exitsignarrowthick, ->] (\exitsignarrowx, \exitsignarrowy) -- ++(\exitsignarrowlength, 0);

% Draw the exit sign text
\node[color=white, align=center, font=\exitsigntextsize] at (\exitsigntextx + \exitsignsize / 2, \exitsigntexty + \exitsignsize / 2) {EXIT};

% Draw the door
\draw[color=doorcolor, fill=doorcolor, thick=\doorthick] (\doorx - \width / 2, \doory) rectangle ++(\width, \height);

% Draw the exit
\draw[color=exitsigncolor, thick=\exitsignthick] (\exitx - \width / 2, \exity) -- ++(0, -\height);

\end{tikzpicture}

\end{document}

