% Importing TikZ package
\usepackage{tikz}

% Defining the main function
\begin{document}
\begin{tikzpicture}

% Setting the radius of the spiral
\def\radius{2}

% Setting the number of months in the calendar
\def\numMonths{12}

% Setting the angle between each month
\def\angleIncrement{360/\numMonths}

% Setting the starting angle of the spiral
\def\startAngle{0}

% Setting the distance between each month
\def\distanceIncrement{0.2}

% Looping through each month to draw the spiral
\foreach \i in {1,...,\numMonths} {

  % Calculating the angle and distance for the current month
  \pgfmathsetmacro{\angle}{\startAngle + \i * \angleIncrement}
  \pgfmathsetmacro{\distance}{\i * \distanceIncrement}

  % Calculating the x and y coordinates for the current month
  \pgfmathsetmacro{\x}{\radius * \distance * cos(\angle)}
  \pgfmathsetmacro{\y}{\radius * \distance * sin(\angle)}

  % Drawing a circle at the current coordinates
  \filldraw (\x,\y) circle (0.1);

}

\end{tikzpicture}
\end{document}

