\documentclass{article}

% Load TikZ package
\usepackage{tikz}

% Define the size of the onion
\def\onionSize{4}

% Define the number of layers in the onion
\def\numLayers{5}

% Define the color of the onion
\definecolor{onionColor}{RGB}{255, 204, 102}

% Define the color of the onion's core
\definecolor{coreColor}{RGB}{255, 153, 51}

% Define the thickness of each layer
\def\layerThickness{0.2}

% Define the radius of the onion's core
\def\coreRadius{0.5}

% Define the distance between each layer
\def\layerDistance{0.2}

% Define the angle between each layer
\def\layerAngle{10}

\begin{document}

% Create a TikZ picture
\begin{tikzpicture}

% Draw the onion's core
\filldraw[coreColor] (0,0) circle (\coreRadius);

% Draw each layer of the onion
\foreach \layer in {1,...,\numLayers}{
    % Calculate the radius of the current layer
    \pgfmathsetmacro{\layerRadius}{\onionSize - \layer*\layerThickness}

    % Calculate the angle of the current layer
    \pgfmathsetmacro{\layerAngleOffset}{\layerAngle*(\layer-1)}

    % Draw the current layer
    \filldraw[onionColor] (\layerAngleOffset:\layerRadius) arc (\layerAngleOffset:\layerAngleOffset+\layerAngle:\layerRadius) -- ++(\layerAngleOffset+\layerAngle:\layerDistance) arc (\layerAngleOffset+\layerAngle:\layerAngleOffset:\layerRadius+\layerThickness) -- cycle;
}

\end{tikzpicture}

\end{document}

