% Define the main function for drawing the bonnet
\newcommand{\drawBonnet}[1]{
  % Define the dimensions of the bonnet
  \def\height{#1}
  \def\width{1.5*\height}
  \def\depth{0.5*\height}

  % Draw the top of the bonnet
  \draw[fill=black!20] (0,0) -- (\width,0) -- (\width,\depth) -- (0,\depth) -- cycle;

  % Draw the sides of the bonnet
  \draw[fill=black!40] (\width,0) -- (\width+\depth,\depth) -- (\width+\depth,\height) -- (\width,\height) -- cycle;
  \draw[fill=black!40] (0,0) -- (\depth,0) -- (\depth,\height) -- (0,\height) -- cycle;

  % Draw the front of the bonnet
  \draw[fill=black!60] (\depth,0) -- (\width,0) -- (\width,\height) -- (\depth,\height) -- cycle;

  % Draw the top of the bonnet
  \draw[fill=black!80] (0,\height) -- (\depth,\height) -- (\width+\depth,\height) -- (\width,\height) -- cycle;
}

