  % Draw the face outline
  \draw[lineStyle] (center) circle (\faceSize);
  % Draw the eyes
  \filldraw[lineStyle] (leftEye) circle (\eyeSize) (rightEye) circle (\eyeSize);
  % Draw the mouth
  \draw[lineStyle] (mouth) ellipse ({\mouthSize} and {0.5*\mouthSize});
}

