% Drawing the left face of the liquid
\draw[thick] (\glassleft+\glassthickness,\liquidfront) -- (\glassleft+\glassthickness,\liquidtop);

% Drawing the right face of the liquid
\draw[thick] (\glassright-\glassthickness,\liquidfront) -- (\glassright-\glassthickness,\liquidtop);

% Drawing the bottom face of the liquid
