\usepackage{tikz}
\usetikzlibrary{positioning}

% Define colors
\definecolor{background}{HTML}{F7F7F7}
\definecolor{line}{HTML}{CCCCCC}
\definecolor{keyword}{HTML}{0000FF}
\definecolor{string}{HTML}{008000}
\definecolor{comment}{HTML}{808080}

% Define code style
\tikzset{
  code/.style={
    font=\ttfamily,
    text=black,
    minimum height=1cm,
    minimum width=2cm,
    draw=line,
    fill=background,
    align=center,
    inner sep=0pt,
    outer sep=0pt,
  },
  keyword/.style={
    text=keyword,
  },
  string/.style={
    text=string,
  },
  comment/.style={
    text=comment,
  },
}

% Define code editor environment
\newenvironment{codeeditor}{
  \begin{tikzpicture}
    % Draw code boxes
    \node[code] (line1) {int main()};
    \node[code, below=0pt of line1] (line2) { \{ };
    \node[code, below=0pt of line2] (line3) {    printf("Hello, world!"); };
    \node[code, below=0pt of line3] (line4) {    return 0; };
    \node[code, below=0pt of line4] (line5) { \} };
    % Add line numbers
    \foreach \i in {1,...,5} {
      \node[right=5pt of line\i.west, anchor=west, font=\tiny] {\i};
    }
    % Add syntax highlighting
    \node[keyword, above right=0pt and 5pt of line1.north west] {int} edge[line] (line1.north west);
    \node[keyword, above right=0pt and 5pt of line3.north west] {printf} edge[line] (line3.north west);
    \node[string, above right=0pt and 5pt of line3.north east] {"Hello, world!"} edge[line] (line3.north east);
    \node[comment, above right=0pt and 5pt of line4.north west] {// Return 0} edge[line] (line4.north west);
  }{
  \end{tikzpicture}
}

% Example usage
\begin{document}
  \begin{codeeditor}
  \end{codeeditor}
\end{document}

